        }

        /// <summary>
        /// Creates a new <see cref="HTMLStripCharFilter"/> over the provided <see cref="TextReader"/>
        /// with the specified start and end tags.
        /// </summary>
        /// <param name="source"><see cref="TextReader"/> to strip html tags from.</param>
        /// <param name="escapedTags">Tags in this set (both start and end tags) will not be filtered out.</param>
        public HTMLStripCharFilter(TextReader source, ICollection<string> escapedTags)
                    : base(source)
        {
            this.outputSegment = inputSegment;
            this.zzReader = GetBufferedReader(source);
            if (null != escapedTags)
            {
                var comparer = CultureInfo.InvariantCulture.CompareInfo;
                foreach (string tag in escapedTags)
                {
                    if (comparer.Compare(tag, "BR", CompareOptions.IgnoreCase) == 0)
                    {
                        escapeBR = true;
                    }
                    else if (comparer.Compare(tag, "SCRIPT", CompareOptions.IgnoreCase) == 0)
                    {
                        escapeSCRIPT = true;
                    }
                    else if (comparer.Compare(tag, "STYLE", CompareOptions.IgnoreCase) == 0)
                    {
                        escapeSTYLE = true;
                    }
                    else
                    {
                        if (null == this.escapedTags)
                        {
#pragma warning disable 612, 618
                            this.escapedTags = new CharArraySet(LuceneVersion.LUCENE_CURRENT, 16, true);
#pragma warning restore 612, 618
                        }
                        this.escapedTags.Add(tag);
                    }
                }
            }
        }

