        private static BufferedCharFilter GetBufferedReader(TextReader reader)
        {
            return (reader is BufferedCharFilter) ? (BufferedCharFilter)reader : new BufferedCharFilter(reader);
        }

        public override int Read()
        {
            if (outputSegment.IsRead)
            {
                if (zzAtEOF)
                {
                    return -1;
                }
                int ch1 = NextChar();
                ++outputCharCount;
                return ch1;
            }
            int ch2 = outputSegment.NextChar();
            ++outputCharCount;
            return ch2;
        }

        public override int Read(char[] cbuf, int off, int len)
        {
            int i = 0;
            for (; i < len; ++i)
            {
                int ch = Read();
                if (ch == -1) break;
                cbuf[off++] = (char)ch;
            }
            return i > 0 ? i : (len == 0 ? 0 : -1);
        }

