        /// <summary>
        /// Reports an error that occured while scanning.
        /// <para/>
        /// In a wellformed scanner (no or only correct usage of
        /// YyPushBack(int) and a match-all fallback rule) this method 
        /// will only be called with things that "Can't Possibly Happen".
        /// If this method is called, something is seriously wrong
        /// (e.g. a JFlex bug producing a faulty scanner etc.).
        /// <para/>
        /// Usual syntax/scanner level error handling should be done
        /// in error fallback rules.
        /// </summary>
        /// <param name="errorCode">the code of the errormessage to display</param>
        private static void ZzScanError(int errorCode) // LUCENENET: CA1822: Mark members as static
        {
            string message;
            // LUCENENET specific: Defensive check so we don't have to catch IndexOutOfRangeException
            if (errorCode >= 0 && errorCode < ZZ_ERROR_MSG.Length)
            {
                message = ZZ_ERROR_MSG[errorCode];
            }
            else
            {
                message = ZZ_ERROR_MSG[ZZ_UNKNOWN_ERROR];
            }

            throw Error.Create(message);
        }

        /// <summary>
        /// Pushes the specified amount of characters back into the input stream.
        /// 
        /// They will be read again by then next call of the scanning method
        /// </summary>
        /// <param name="number">the number of characters to be read again.
        /// This number must not be greater than YyLength()!</param>
        private void YyPushBack(int number)
        {
            if (number > YyLength)
                ZzScanError(ZZ_PUSHBACK_2BIG);

            zzMarkedPos -= number;
        }


        /// <summary>
        /// Contains user EOF-code, which will be executed exactly once,
        /// when the end of file is reached
        /// </summary>
        private void ZzDoEOF()
        {
            if (!zzEOFDone)
            {
                zzEOFDone = true;
                switch (zzLexicalState)
                {
                    case SCRIPT:
                    case COMMENT:
                    case SCRIPT_COMMENT:
                    case STYLE:
                    case STYLE_COMMENT:
                    case SINGLE_QUOTED_STRING:
                    case DOUBLE_QUOTED_STRING:
                    case END_TAG_TAIL_EXCLUDE:
                    case END_TAG_TAIL_SUBSTITUTE:
                    case START_TAG_TAIL_EXCLUDE:
                    case SERVER_SIDE_INCLUDE:
                    case START_TAG_TAIL_SUBSTITUTE:
                        { // Exclude
                          // add (length of input that won't be output) [ - (substitution length) = 0 ]
                            cumulativeDiff += yychar - inputStart;
                            // position the correction at (already output length) [ + (substitution length) = 0 ]
                            AddOffCorrectMap(outputCharCount, cumulativeDiff);
                            outputSegment.Clear();
                            eofReturnValue = -1;
                            break;
                        }
                    case CHARACTER_REFERENCE_TAIL:
                        {        // Substitute
                                 // At end of file, allow char refs without semicolons
                                 // add (length of input that won't be output) - (substitution length)
                            cumulativeDiff += inputSegment.Length - outputSegment.Length;
                            // position the correction at (already output length) + (substitution length)
                            AddOffCorrectMap(outputCharCount + outputSegment.Length, cumulativeDiff);
                            eofReturnValue = outputSegment.Length > 0 ? outputSegment.NextChar() : -1;
                            break;
                        }
                    case BANG:
                    case CDATA:
                    case AMPERSAND:
                    case NUMERIC_CHARACTER:
                    case END_TAG_TAIL_INCLUDE:
                    case START_TAG_TAIL_INCLUDE:
                    case LEFT_ANGLE_BRACKET:
                    case LEFT_ANGLE_BRACKET_SLASH:
                    case LEFT_ANGLE_BRACKET_SPACE:
                        {        // Include
                            outputSegment = inputSegment;
                            eofReturnValue = outputSegment.Length > 0 ? outputSegment.NextChar() : -1;
                            break;
                        }
                    default:
                        {
                            eofReturnValue = -1;
                        }
                        break;
                }

            }
        }

